import getDataFromApi from "../services/api";

const App = (props) => {
  useEffect(() => {
    getDataFromApi().then((each) => {
      console.log(each.name);
    });
  });
  return (
    <div>
      <img />
      <h1>Nombre: </h1>
      <h2>Especie: </h2>
    </div>
  );
};

export default App;
